import React from 'react'
import Button from './button'

const Map = ({colors}) => (
    console.log("Colors", colors),
    <>
    {
        colors.array.forEach(element => (
            <div>
                <Button props={element} />
            </div>  
        ))

    }
    </>
)

export default Map
